import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
const Life = () =>  (
    <div >
        <Row> 
        <Col>
           <div id="my-life">
            <Card className="life-paragraph">
            <Card.Body>
                <h1>My Life</h1>
                <Card.Text className="text-muted">
                20 Years Old. Burmese. Computer Science student. I love animals and photography. Living in SG for > 14 years.
                </Card.Text>
                <Card.Link href="#">Professional Resume</Card.Link>
            </Card.Body>
            </Card>
   
           </div>
       </Col>
        </Row>
    </div>
    


);

export default Life;
